import React from 'react';
import {Link} from 'react-router-dom'

function LinkHome (props) {
  return (
    <div
      className={props.menuNavigationHome ? "linkLayout linkLayout--active" : "linkLayout"}
      checked={props.menuNavigationHome}
      onClick={props.changeHome}
    >
      <Link
        to="/Home"
        className="link"
      >
        Главная
      </Link>
    </div>
  )
}

export default LinkHome
